import React from 'react'

export class Canvas extends React.Component {

	constructor() {
		super();
	}

	render() {

		var canvasStyle = {
			"border": "2px solid black",
			"marginTop": "100pt",
			"width": "450pt",
			"height": "250pt"
		}

		return (<div>
			<canvas style={canvasStyle}>
				Sorry your browser does not support canvas.Update it
			</canvas>
		</div>)
	}

}
